import styled from "styled-components";

const FooterWrapper = styled.div`

  .add {
    background-color: #bdffcc;
    padding: 0;
    border-radius: 50%;
    position: fixed;
    height: 70px;
    width: 70px;
  }
`;

export default FooterWrapper;
